import React from 'react';
import './JoinSection.css';


const ServiceTopSection = () => {
    return (
      <div className="join-section-wrapper">
        <div className="join-section-container">
          <h2>Join the waitlist</h2>
          <p>Get early access to Wreckbot AI and start securing your applications today.</p>

        </div>

      </div>
    );
  }

  export default ServiceTopSection;
